import React, { useEffect, useState } from "react";
import "./userpage.css"

const UserPage = () => {
    const [users, setUsers] = useState([]);

    const callApi = async () => {
        const data = await fetch("http://localhost:3000/users");
        const users = await data.json();
        setUsers(users);
    };
    return (
        <div></div>
    )

}
export default UserPage;
